import React from 'react';
import "../../assets/styles/stat.css";

const FrameStatistique = () => {
    const [marqueData, setMarqueData] = useState([]);
    const token = sessionStorage.getItem('token');

    console.log(token);
    useEffect(() => {
        if (!token) {
            window.location.href = '/login';
        }
        const fetchData = async () => {
            try {
                const headers = new Headers();
                headers.append('token', token);
                const response = await fetch('https://e-vehicule-production-c2e4.up.railway.app/marques/', {
                    method: 'GET',
                    headers: {
                        'Authorization':`Bearer ${token}`,
                        'Content-Type':'application/json',
                    },
                });
                const datas = await response.json();
                if (response.ok) {
                    setMarqueData(datas.data);
                } else {
                    alert(JSON.stringify(datas));
                    window.location.href = '/logout';
                }

                console.log(datas);
            } catch (error) {
                console.error('Erreur lors de la récupération des données:', error);
            }
        };

        fetchData();
    }, [token]);

    return (
        <div class="simple-bar-chart">
            <div class="item">
                <div class="label">Label 1</div>
                <div class="value">80%</div>
            </div>

            <div class="item">
                <div class="label">Label 2</div>
                <div class="value">50%</div>
            </div>
  
            <div class="item">
                <div class="label">Label 3</div>
                <div class="value">100%</div>
            </div>
            
            <div class="item">
                <div class="label">Label 4</div>
                <div class="value">15%</div>
            </div>
            
            <div class="item">
                <div class="label">Label 5</div>
                <div class="value">1%</div>
            </div>
            
            <div class="item">
                <div class="label">Label 6</div>
                <div class="value">90%</div>
            </div>
        </div>
    );
};

export default FrameStatistique;
